import React from "react"

function MojProfilPrikaz(props){
    return(
        <div id="prikazProfila">
            <p>Korisnicko ime: {props.state.user.korisnickoIme} </p>
            <p>Tip korisnika: {props.state.user.tipKorisnika} </p>
        </div>
    )
}

export default MojProfilPrikaz
